commits.content:
dashboard-container {
    padding: 20px;
}
.account-section, .products-section, .sales-section {
    margin-bottom: 20px;
}
.profile-pic {
    width: 100px;
    height: 100px;
    border-radius: 50%;
    object-fit: cover;
}
.product-card {
    border: 1px solid #ddd;
    padding: 10px;
    margin: 10px;
    display: inline-block;
    text-align: center;
}
.edit-product-modal {
    position: fixed;
    background: white;
    padding: 20px;
    border: 1px solid #ddd;
}
